import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { CharacterPart } from './components/CharacterPart.js';
import { CharacterSelector } from './components/CharacterSelector.js';
import { CharacterCanvas } from './components/CharacterCanvas.js';
import { CharacterGenerator } from './components/CharacterRandomGenerator.js';
import { Header } from './components/header.js';
import { Main } from './components/main.js';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App Header = {Header} Main = {Main} CharacterPart={CharacterPart} CharacterSelector = {CharacterSelector} CharacterCanvas ={CharacterCanvas} CharacterGenerator = {CharacterGenerator} />);




// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
